// Function to upload an image and get the image_uuid
async function uploadImage(base64Image) {
    try {
      const response = await fetch('https://s.finderly.store/sc-image-upload', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({ image: base64Image })
      });
  
      const data = await response.json();
  
      if (response.ok) {
        console.log('Image uploaded successfully:', data);
        return data.image_uuid;
      } else {
        console.error('Error uploading image:', data.error);
        return null;
      }
    } catch (error) {
      console.error('Network error:', error);
      return null;
    }
  }
  
  // Function to generate a lead using the image_uuid
  async function generateLead(imageUuid, query = '', zipcode = '') {
    try {
      const response = await fetch('https://s.finderly.store/sc-lead', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({ image_uuid: imageUuid, query, zipcode })
      });
  
      const data = await response.json();
  
      if (response.ok) {
        console.log('Lead generated successfully:', data);
      } else {
        console.error('Error generating lead:', data.error);
      }
    } catch (error) {
      console.error('Network error:', error);
    }
  }
  
  // Example usage
  (async () => {
    // Replace this with your actual Base64 image string (with the data:image/jpeg;base64, prefix)
    const base64Image = "data:image/jpeg;base64,";
  
    // Step 1: Upload the image and get the image_uuid
    const imageUuid = await uploadImage(base64Image);
    if (!imageUuid) return;
    console.log('Image uuid:', imageUuid);
  
    // Step 2: Generate a lead using the image_uuid
    await generateLead(imageUuid, 'Looking to remodel my floor.', '90210');
  })();
  